import{_ as r,a,b as e,c as l,d as o,e as i,f as d,g as p,h as s,i as n,j as c,k as h,l as m,m as u,n as _,o as f,p as b,q as g,r as k}from"./chunks/qgc_airframe_generic_quadx.Byf5Pgjg.js";import{_ as C,c as P,o as v,ab as S,m as t,a as A}from"./chunks/framework.CUflZczI.js";const N=JSON.parse('{"title":"Збірка DJI FlameWheel 450 + CUAV V5 nano","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/dji_f450_cuav_5nano.md","filePath":"uk/frames_multicopter/dji_f450_cuav_5nano.md"}'),w={name:"uk/frames_multicopter/dji_f450_cuav_5nano.md"},y=S('<h1 id="збірка-dji-flamewheel-450-cuav-v5-nano" tabindex="-1">Збірка DJI FlameWheel 450 + CUAV V5 nano <a class="header-anchor" href="#збірка-dji-flamewheel-450-cuav-v5-nano" aria-label="Permalink to &quot;Збірка DJI FlameWheel 450 + CUAV V5 nano&quot;">​</a></h1><p>Ця тема надає повні інструкції для збирання комплекту та налаштування PX4 з використанням <em>QGroundControl</em>.</p><p>Основна Інформація</p><ul><li><strong>Каркас:</strong> DJI F450</li><li><strong>Контролер польоту:</strong> <a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a></li><li><strong>Час зборки (приблизно):</strong> 90 хвилин (45 хвилин на раму, 45 хвилин на встановлення/налаштування автопілота)</li></ul><p><img src="'+r+'" alt="Finished setup"></p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><p>Компоненти, необхідні для цієї збірки, є:</p><ul><li>Контролер польоту: <a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">CUAV V5 nano</a>: <ul><li>GPS: <a href="https://store.cuav.net/index.php?id_product=97&amp;id_product_attribute=0&amp;rewrite=cuav-new-ublox-neo-m8n-gps-module-with-shell-stand-holder-for-flight-controller-gps-compass-for-pixhack-v5-plus-rc-parts-px4&amp;controller=product&amp;id_lang=1" target="_blank" rel="noreferrer">CUAV NEO V2 GPS</a></li><li>Модуль живлення</li></ul></li><li>Фрейм: <a href="https://www.amazon.com/Flame-Wheel-Basic-Quadcopter-Drone/dp/B00HNMVQHY" target="_blank" rel="noreferrer">DJI F450</a></li><li>Пропелери: <a href="https://www.masterairscrew.com/products/dji-phantom-built-in-nut-upgrade-propellers-in-black-mr-9-4x5-prop-set-x4-phantom" target="_blank" rel="noreferrer">DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</a></li><li>Акумулятор: <a href="https://hobbyking.com/en_us/turnigy-high-capacity-5200mah-3s-12c-multi-rotor-lipo-pack-w-xt60.html?___store=en_us" target="_blank" rel="noreferrer">Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</a></li><li>Телеметрія: <a href="./../telemetry/holybro_sik_radio.html">Holybro Transceiver Telemetry Radio V3</a></li><li>Пульт дистанційного керування: <a href="https://www.banggood.com/FrSky-D4R-II-2_4G-4CH-ACCST-Telemetry-Receiver-for-RC-Drone-FPV-Racing-p-929069.html?cur_warehouse=GWTR" target="_blank" rel="noreferrer">FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</a></li><li>Мотори: <a href="https://www.amazon.com/DJI-E305-2312E-Motor-960kv/dp/B072MBMCZN" target="_blank" rel="noreferrer">DJI E305 2312E Мотор (960kv,CW)</a></li><li>ESC: Hobbywing XRotor 20A APAC Brushless ESC 3-4S для RC Мультикоптерів</li></ul><p>Крім того, ми використовували контролер FrSky Taranis. Вам також знадобляться хомутів, двостороння стрічка, паяльник.</p><p>На наведеному нижче зображенні показані як рама, так і електронні компоненти.</p><p><img src="'+a+'" alt="All components used in this build"></p><h2 id="обладнання" tabindex="-1">Обладнання <a class="header-anchor" href="#обладнання" aria-label="Permalink to &quot;Обладнання&quot;">​</a></h2><h3 id="рама" tabindex="-1">Рама <a class="header-anchor" href="#рама" aria-label="Permalink to &quot;Рама&quot;">​</a></h3><p>Цей розділ містить усе обладнання для каркасів.</p><table><thead><tr><th>Опис</th><th>Кількість</th></tr></thead><tbody><tr><td>DJI F450 Нижня пластина</td><td>1</td></tr><tr><td>DJI F450 Верхня пластина</td><td>1</td></tr><tr><td>DJI F450 ніжки з шасі</td><td>4</td></tr><tr><td>Гвинти M3*8</td><td>18</td></tr><tr><td>Гвинти M2 5*6</td><td>24</td></tr><tr><td>Акумуляторний ремінь на липучці</td><td>1</td></tr><tr><td>DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</td><td>1</td></tr></tbody></table><p><img src="'+e+'" alt="F450 frame components"></p><h3 id="cuav-v5-nano-package" tabindex="-1">CUAV v5 nano Package <a class="header-anchor" href="#cuav-v5-nano-package" aria-label="Permalink to &quot;CUAV v5 nano Package&quot;">​</a></h3><p>У цьому розділі перераховані компоненти, що входять до складу пакета CUAV v5 nano.</p><table><thead><tr><th>Опис</th><th>Кількість (Набір за замовчуванням)</th><th>Кількість (+GPS Набір)</th></tr></thead><tbody><tr><td>V5 nano політний контролер</td><td>1</td><td>1</td></tr><tr><td>Кабель DuPont</td><td>2</td><td>2</td></tr><tr><td>Кабель I2C/CAN</td><td>2</td><td>2</td></tr><tr><td>Кабель ADC 6.6</td><td>2</td><td>2</td></tr><tr><td>Сигнальний кабель SBUS</td><td>1</td><td>1</td></tr><tr><td>Кабель IRSSI</td><td>1</td><td>1</td></tr><tr><td>Сигнальний кабель DSM</td><td>1</td><td>1</td></tr><tr><td>Кабель ADC 3.3</td><td>1</td><td>1</td></tr><tr><td>Кабель для відладки</td><td>1</td><td>1</td></tr><tr><td>Кабель запобіжного вимикача</td><td>1</td><td>1</td></tr><tr><td>Кабель напруги та струму</td><td>1</td><td>1</td></tr><tr><td>Кабель модуля PW-Link</td><td>1</td><td>1</td></tr><tr><td>Модуль живлення</td><td>1</td><td>1</td></tr><tr><td>Карта пам&#39;яті SanDisk 16GB</td><td>1</td><td>1</td></tr><tr><td>Платка розширення 12C</td><td>1</td><td>1</td></tr><tr><td>ТТЛ-пластина</td><td>1</td><td>1</td></tr><tr><td>NEO GPS</td><td>-</td><td>1</td></tr><tr><td>GPS Bracket</td><td>-</td><td>1</td></tr></tbody></table><h3 id="електроніка" tabindex="-1">Електроніка <a class="header-anchor" href="#електроніка" aria-label="Permalink to &quot;Електроніка&quot;">​</a></h3><table><thead><tr><th>Опис</th><th>Кількість</th></tr></thead><tbody><tr><td>CUAV V5 nano</td><td>1</td></tr><tr><td>CUAV NEO V2 GPS</td><td>1</td></tr><tr><td>Holibro Telemetry</td><td>1</td></tr><tr><td>FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</td><td>1</td></tr><tr><td>DJI E305 2312E Motor (800kv,CW)</td><td>4</td></tr><tr><td>Hobbywing XRotor 20A APAC Brushless ESC</td><td>4</td></tr><tr><td>Модуль живлення (включено в набір CUAV V5 nano)</td><td>1</td></tr><tr><td>Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</td><td>1</td></tr></tbody></table><h3 id="необхідні-інструменти" tabindex="-1">Необхідні інструменти <a class="header-anchor" href="#необхідні-інструменти" aria-label="Permalink to &quot;Необхідні інструменти&quot;">​</a></h3><p>У цій збірці використовуються наступні інструменти:</p><ul><li>Викрутка з шестигранником 2,0 мм</li><li>Шуруповерт Phillips 3 мм</li><li>Кусачки</li><li>Прецизійний пінцет</li><li>Паяльник</li></ul><p><img src="'+l+'" alt="Required tools"></p><h2 id="збірка" tabindex="-1">Збірка <a class="header-anchor" href="#збірка" aria-label="Permalink to &quot;Збірка&quot;">​</a></h2><p>Приблизний час для збирання становить приблизно 90 хвилин (близько 45 хвилин на раму та 45 хвилин на встановлення автопілота та налаштування корпусу.</p><ol><li><p>Прикріпіть 4 ніжки до нижньої пластини за допомогою наданих гвинтів.</p><p><img src="'+o+'" alt="Arms to bottom plate"></p></li><li><p>Припаяйте ЕСК (електронний регулятор швидкості) до плати, позитивний (червоний) та негативний (чорний).</p><p><img src="'+i+'" alt="Solder ESCs"></p></li><li><p>Припаяйте модуль живлення, позитивний (червоний) та негативний (чорний).</p><p><img src="'+d+'" alt="Solder power module"></p></li><li><p>Підключіть двигуни до ESC відповідно до їхніх позицій.</p><p><img src="'+p+'" alt="Plug in motors"></p></li><li><p>Прикріпіть двигуни до відповідних рук.</p><p><img src="'+s+'" alt="Attach motors to arms (white)"> <img src="'+n+'" alt="Attach motors to arms (red)"></p></li><li><p>Додайте верхню дошку (прикрутіть до верхньої частини ніг).</p><p><img src="'+c+'" alt="Add top board"></p></li><li><p>Додайте амортизаційну пінку до польотного контролера <em>CUAV V5 nano</em>.</p><p><img src="'+h+'" alt="Damping foam"> <img src="'+m+'" alt="Damping foam"></p></li><li><p>Прикріпіть приймач FrSky до нижньої плати за допомогою двосторонньої стрічки.</p><p><img src="'+u+'" alt="Attach FrSky receiver with double-sided tape"></p></li><li><p>Прикріпіть телеметричний модуль до нижньої плати транспортного засобу за допомогою двосторонньої стрічки.</p><p><img src="'+_+'" alt="Attach telemetry radio"> <img src="'+f+'" alt="Attach telemetry radio"></p></li><li><p>Поставте алюмінієві опори на платформу кнопок і прикріпіть GPS.</p><p><img src="'+b+'" alt="Aluminium standoffs"></p></li><li><p>Підключіть телеметрію (<code>TELEM1</code>), модуль GPS (<code>GPS/SAFETY</code>), приймач RC (<code>RC</code>), всі 4 ESC (<code>M1-M4</code>), та модуль живлення (<code>Power1</code>) до контролера польоту. <img src="'+g+'" alt="Attach peripherals to flight controller"></p><div class="info custom-block"><p class="custom-block-title">Порядок мотора визначено в <a href="./../airframes/airframe_reference.html#quadrotor-x">Довідник з літальних апаратів &gt; Квадрокоптер x</a></p></div></li></ol><p>:::</p><p>Ось і все! Останню збірку показано нижче:</p><p><img src="'+r+'" alt="Finished Setup"></p><h2 id="налаштування-px4" tabindex="-1">Налаштування PX4 <a class="header-anchor" href="#налаштування-px4" aria-label="Permalink to &quot;Налаштування PX4&quot;">​</a></h2><p><em>QGroundControl</em> використовується для встановлення автопілота PX4 та його налаштування / налаштування для рами. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Завантажте та встановіть</a> <em>QGroundControl</em> для вашої платформи.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Повні інструкції щодо встановлення та налаштування PX4 можна знайти в <a href="./../config/">Основна конфігурація</a>.</p></div><p>Спочатку оновіть прошивку, конструкцію та виходи:</p><ul><li><p><a href="./../config/firmware.html">Прошивка</a></p></li><li><p><a href="./../config/airframe.html">Планер</a></p><div class="info custom-block"><p class="custom-block-title">Вам потрібно буде вибрати шасі <em>Generic Quadcopter</em> (<strong>Квадрокоптер x &gt; Generic Quadcopter</strong>).</p><p><img src="'+k+'" alt="QGroundControl - Select Generic Quadcopter"></p></div></li></ul><p>:::</p><ul><li><a href="./../config/actuators.html">Приводи</a><ul><li>Оновіть геометрію транспортного засобу, щоб вона відповідала рамі.</li><li>Призначте функції приводу до виходів, щоб відповідати вашому підключенню.</li><li>Перевірте конфігурацію, використовуючи слайдери.</li></ul></li></ul><p>Потім виконайте обов&#39;язкове налаштування / калібрування:</p><ul><li><p><a href="./../config/flight_controller_orientation.html">Орієнтація сенсора</a></p></li><li><p><a href="./../config/compass.html">Компас</a></p></li><li><p><a href="./../config/accelerometer.html">Акселерометр</a></p></li><li><p><a href="./../config/level_horizon_calibration.html">Калібрування рівня горизонту</a></p></li><li><p><a href="./../config/radio.html">Налаштування радіо</a></p></li><li><p><a href="./../config/flight_mode.html">Режими польоту</a></p><div class="info custom-block"><p class="custom-block-title">Для цієї збірки ми налаштували режими <em>Стабілізований</em>, <em>Висота</em> та <em>Позиція</em> на трьохпозиційний перемикач на приймачі (відображений на один канал - 5). Це рекомендований мінімальний набір режимів для початківців.</p></div></li></ul><p>:::</p><p>В ідеалі ви також повинні зробити:</p><ul><li><a href="./../advanced_config/esc_calibration.html">Калібрування ESC</a></li><li><a href="./../config/battery.html">Налаштування оцінки батареї</a></li><li><a href="./../config/safety.html">Безпека</a></li></ul><h2 id="вдосконалення" tabindex="-1">Вдосконалення <a class="header-anchor" href="#вдосконалення" aria-label="Permalink to &quot;Вдосконалення&quot;">​</a></h2><p>Набори вибору конструкції встановлюють параметри автопілота <em>за замовчуванням</em> для рами. Ці можуть бути достатньо хороші для польоту, але вам слід налаштувати кожну конструкцію рами.</p><p>Для інструкцій щодо того, як розпочати, почніть з <a href="./../config/autotune.html">Автоналаштування</a>.</p><h2 id="відео" tabindex="-1">Відео <a class="header-anchor" href="#відео" aria-label="Permalink to &quot;Відео&quot;">​</a></h2>',47),V=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/b0bKNdDqVHw",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),x=t("h2",{id:"подяки",tabindex:"-1"},[A("Подяки "),t("a",{class:"header-anchor",href:"#подяки","aria-label":'Permalink to "Подяки"'},"​")],-1),D=t("p",null,"Цей журнал збірки був наданий Командою тестового польоту Dronecode.",-1),q=[y,V,x,D];function I(T,E,G,F,R,U){return v(),P("div",null,q)}const H=C(w,[["render",I]]);export{N as __pageData,H as default};
